import React, { Component } from 'react';
import './../css/component/playstore.css';
import { FaNpm, FaGithub, FaDochub } from "react-icons/fa";

class PlayStore extends Component {

    render() {
        return (
            <div className="play-store">
                <a href="https://www.npmjs.com/package/backless" className="custom-btn d-inline-flex align-items-center"><FaNpm /><p>Download here<span>NPM</span></p></a>
                <a href="https://github.com/Backless-Js/Backless-Js" className="custom-btn d-inline-flex align-items-center"><FaGithub /><p>Contribute here<span>Github</span></p></a>
                <a href="https://www.npmjs.com/package/backless" className="custom-btn d-inline-flex align-items-center"><p>Get Started<span> Started</span></p></a>
            </div>
        )
    }
}

export default PlayStore;
